pub fn lexer_switch( self: *Lexer, accept: u8 ) Id {
  switch (accept) {
 0 => 
// LBrace
// %dfa {
{
    if(self.index == 1) return Id.LBrace;
    switch(self.source[self.index-2]) {
        ':', ' ', '\t', '\r', '\n' =>  return Id.LBrace,
        else => return Id.LCurly,
    }
},
 1 => 
// Space
// %dfa ( )+
{
    return Id.Ignore;
},
 2 => 
// Comments
// %dfa //
{
    var comment_id = Id.LineComment;

    if (self.peek == '/') {
        _ = self.getc();
        if (self.peek != '/') {
            comment_id = Id.DocComment;
        }
    }

    while (true) {
        switch (self.peek) {
            '\n', -1 => return comment_id,
            else => {},
        }
        _ = self.getc();
    }
},
 3 => 
// LineString
// %dfa \\\\
{
    while (true) {
        switch (self.peek) {
            '\n', -1 => return Id.LineString,
            else => {},
        }
        _ = self.getc();
    }
},
 4 => 
// LineCString
// %dfa c\\\\
{
    while (true) {
        switch (self.peek) {
            '\n', -1 => return Id.LineCString,
            else => {},
        }
        _ = self.getc();
    }
},
 5 => 
// CharLiteral
// %dfa '
{
    while (true) {
        switch (self.peek) {
            '\n', -1 => return Id.Invalid,
            '\\' => {
                _ = self.getc();
            },
            '\'' => {
                _ = self.getc();
                return Id.CharLiteral;
            },
            else => {},
        }
        _ = self.getc();
    }
},
 6 => 
// StringLiteral
// %dfa "
{
    while (true) {
        switch (self.peek) {
            '\n', -1 => {
                // TODO: error
                return Id.StringLiteral;
            },
            '\\' => {
                _ = self.getc();
            },
            '"' => {
                _ = self.getc();
                return Id.StringLiteral;
            },
            else => {},
        }
        _ = self.getc();
    }
},
 7 => 
// StringLiteral
// %dfa c"[^"]
{
    while (true) {
        switch (self.peek) {
            '\n', -1 => {
                // TODO: error
                return Id.StringLiteral;
            },
            '\\' => {
                _ = self.getc();
            },
            '"' => {
                _ = self.getc();
                return Id.StringLiteral;
            },
            else => {},
        }
        _ = self.getc();
    }
},
 8 => 
// ShebangLine
// %dfa #!
{
    if (self.index != 2)
        return Id.Invalid;

    while (true) {
        switch (self.peek) {
            '\n', -1 => return Id.ShebangLine,
            else => {},
        }
        _ = self.getc();
    }
},
else => unreachable,
}
return .Invalid;
}